'use strict';
class CollectDataSettings {
    isSendMetricsEnabledField;
    isSendErrorsEnabledField;
    constructor() {
        this.isSendMetricsEnabledField = false;
        this.isSendErrorsEnabledField = false;
    }
    setSendMetricsEnabled(enabled) {
        this.isSendMetricsEnabledField = enabled;
    }
    setSendErrorsEnabled(enabled) {
        this.isSendErrorsEnabledField = enabled;
    }
    isSendMetricsEnabled() {
        return this.isSendMetricsEnabledField;
    }
    isSendErrorsEnabled() {
        return this.isSendErrorsEnabledField;
    }
}
module.exports = CollectDataSettings
